import React from "react";
import { Grid } from "@material-ui/core";

function Arrowx({
  clickSlideprev,
  clickSlidenext,
  imageHeight,
  pey,
}: any): JSX.Element {
  return (
    <>
      <>
        <Grid
          container
          style={{
            position: "absolute",
            top: "0em",
            zIndex: 2,
            height: "0px",
            width: "100%",
            padding: "0px",
          }}
        >
          <Grid
            item
            onClick={clickSlideprev}
            className="slider-arrow-backpad-left"
            style={{
              backgroundColor: "#cccccc",
              height: `${imageHeight[pey]}px`,
              height: `${itemheight[pey]}px`,
              cursor: "pointer",
            }}
            xs={2}
          >
            {" "}
          </Grid>{" "}
          <Grid item style={{ height: "0px" }} xs={8}>
            {" "}
          </Grid>{" "}
          <Grid
            item
            onClick={clickSlidenext}
            className="slider-arrow-backpad-right"
            style={{
              height: `${imageHeight}px`,
              cursor: "pointer",
            }}
            xs={2}
          >
            {" "}
          </Grid>
        </Grid>
      </>
    </>
  );
}

export const Arrow = React.memo(Arrowx);
